import Header from '../header/Header.js';
import * as a from './StyledMain.js';

function Main() {
  return (
    <div>
        <Header/>
        <a.ContentWrap>
            <a.MainContent>Diet</a.MainContent>
            <a.MenuWrap>
              <a.Menu>다이어트</a.Menu>
              <a.Menu>벌크업</a.Menu>
              <a.Menu>건강식</a.Menu>
            </a.MenuWrap>
        </a.ContentWrap>
    </div>
  );
}

export default Main;
